import React from 'react';
import { Tab, Tabs as TabsComponent, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';

const Tabs = ({ data }) => {
  console.log(data);
  return (
    <TabsComponent>
      <TabList>
        {data.map(({ razred }, i) => (
          <Tab key={i}>{razred.razred}</Tab>
        ))}
      </TabList>
      {data.map(({ razred }, i) => (
        <TabPanel key={i}>{razred.razrednik}</TabPanel>
      ))}
    </TabsComponent>
  );
};

export default Tabs;
